import react from "react";
import {View,Text} from 'react-native';
import { NavigationContainer } from '@react-navigation/native';


const Navigation=()=>{
    return(
        <NavigationContainer>
            <Text>Navigation</Text>
        </NavigationContainer>
    );
};

export default Navigation;
